import { Popup } from './Popup';
import loginerr from '../images/loginerr.png';

function InfoTooltip(props) {
  return (
    <Popup isOpened={props.isOpened} onClose={''}>
      <div className="popup__tooltip-container">
        <img className="popup__tooltip-img" src={loginerr} />
        <span className="popup__tooltip-description">{'Что-то пошло не так'}</span>
      </div>
    </Popup>
  );
}

export { InfoTooltip };
